import React from 'react';
import './App.scss';
import Menu from './containers/Menu/Menu.js'
import Main from './containers/Main/Main.js'


function App() {
  return (
    <div classNameName="App">
      <div classNameName='row'>
        <div classNameName='col-2'>
          <Menu />
        </div>
        <div classNameName='col-10'>
          <Main />
        </div>
      </div>
    </div>
  );

}

export default App;
